import React from "react";
import TreeView from "@mui/lab/TreeView";
import { styled } from "@mui/material/styles";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";
import ChevronRightIcon from "@mui/icons-material/ChevronRight";
import TreeItem from "@mui/lab/TreeItem";
import { Grid } from "@mui/material";

const StyledTreeView = styled(TreeView)({
  height: 240,
  flexGrow: 1,
  maxWidth: 400,
});

export default function FileSystemNavigator() {
  return (
    <Grid container spacing={2}>
      <Grid item xs={12}>
        {/* Árbol */}
        <StyledTreeView
          defaultCollapseIcon={<ExpandMoreIcon />}
          defaultExpandIcon={<ChevronRightIcon />}
        >
          {/* Reinos */}
          <TreeItem nodeId="reinos" label="Reinos">
            {/* Animalia */}
            <TreeItem nodeId="animalia" label="Animalia">
              {/* Filos */}
              <TreeItem nodeId="animalia_filos" label="Filos">
                <TreeItem nodeId="acanthocephala" label="Acanthocephala" />
                <TreeItem nodeId="annelida" label="Annelida" />
                <TreeItem nodeId="arthropoda" label="Arthropoda">
                  {/* Clases */}
                  <TreeItem nodeId="arthropoda_clases" label="Clases">
                    <TreeItem nodeId="arachnida" label="Arachnida">
                      {/* Órdenes */}
                      <TreeItem nodeId="arachnida_ordenes" label="Órdenes">
                        <TreeItem nodeId="blattodea" label="Blattodea" />
                        <TreeItem nodeId="coleoptera" label="Coleoptera" />
                        <TreeItem nodeId="dermaptera" label="Dermaptera" />
                        <TreeItem nodeId="diptera" label="Diptera">
                          {/* Familias */}
                          <TreeItem nodeId="diptera_familias" label="Familias">
                            <TreeItem nodeId="acanthomeridae" label="Acanthomeridae" />
                            <TreeItem nodeId="acartophthalmidae" label="Acartophthalmidae" />
                            <TreeItem nodeId="acroceridae" label="Acroceridae" />
                            <TreeItem nodeId="agromyzidae" label="Agromyzidae" />
                            {/* Repite la estructura para más familias */}
                          </TreeItem>
                        </TreeItem>
                        <TreeItem nodeId="embioptera" label="Embioptera" />
                      </TreeItem>
                    </TreeItem>
                    <TreeItem nodeId="chilopoda" label="Chilopoda" />
                    <TreeItem nodeId="crustacea" label="Crustacea" />
                    {/* Repite la estructura para más clases de arthropoda */}
                  </TreeItem>
                </TreeItem>
                <TreeItem nodeId="brachiopoda" label="Brachiopoda" />
                <TreeItem nodeId="bryozoa" label="Bryozoa" />
                <TreeItem nodeId="cephalorhyncha" label="Cephalorhyncha" />
                <TreeItem nodeId="chaetognatha" label="Chaetognatha" />
              </TreeItem>
            </TreeItem>
            <TreeItem nodeId="fungi" label="Fungi" />
            <TreeItem nodeId="moner" label="Moner" />
            <TreeItem nodeId="plantae" label="Plantae" />
            <TreeItem nodeId="protista" label="Protista" />
          </TreeItem>
        </StyledTreeView>
      </Grid>
    </Grid>
  );
}
